    <script src="lib/lz-string.js"></script>
    <script src="lib/lzma.js"></script>
    <script type="text/javascript">
        let defaultOrigin = document.querySelector('#origin-data').innerHTML.trim()
        defaultOrigin = JSON.stringify(JSON.parse(defaultOrigin))
        defaultOrigin = defaultOrigin.repeat(2)
        // defaultOrigin = defaultOrigin.slice(0, 150 * 1000)
        let originEle = document.querySelector('textarea[name=origin]')
        let compressEle = document.querySelector('textarea[name=compress]')

        originEle.value = defaultOrigin.slice(0, 100)


        let lzstringCompKeys = [
            "compressToBase64",
            "compressToUTF16",
            "compressToUint8Array",
            "compressToEncodedURIComponent",
            "compress",
        ]

        let lzstringDecompKeys = [
            "decompressFromBase64",
            "decompressFromUTF16",
            "decompressFromUint8Array",
            "decompressFromEncodedURIComponent",
            "decompress",
        ]

        document.querySelector('#lz-string #btn').innerHTML = lzstringCompKeys.filter(key => key.includes('compress')).map(key => {
            return `<button onclick="LZFns('${key}')">${key}</button>`
        }).join('&emsp;')

        function LZFns(key) {
            let idx = lzstringCompKeys.findIndex(i => i == key)
            let originData = defaultOrigin.repeat(10)
            let t0 = + new Date()
            let compressData = LZString[lzstringCompKeys[idx]](originData)
            let jsHeap0 = performance.memory.usedJSHeapSize
            console.log(`${key} 压缩完成 当前使用的内存: ${parseInt((performance.memory.usedJSHeapSize - jsHeap0) / 1000 / 1000)}M`)
            let t1 = + new Date()
            LZString[lzstringDecompKeys[idx]](compressData)
            console.log(`${key} 解压完成 当前使用的内存: ${parseInt((performance.memory.usedJSHeapSize - jsHeap0) / 1000 / 1000)}M`)
            let t2 = + new Date()
            document.querySelector('#lz-string #result').innerHTML += `<p> ${key}:: 压缩耗时: ${t1 - t0} ms,  解压耗时: ${t2 - t1} ms, 原长度: ${parseInt(originData.length / 1000)}K, 压缩后: ${parseInt(compressData.length) / 1000}K, 压缩比: ${(compressData.length / originData.length).toFixed(4)} , 使用内存 </p>`
            console.log(`${key}:: 压缩耗时: ${t1 - t0} ms,  解压耗时: ${t2 - t1} ms, 原长度: ${parseInt(originData.length / 1000)}K, 压缩后: ${parseInt(compressData.length) / 1000}K, 压缩比: ${(compressData.length / originData.length).toFixed(4)}`)

            compressEle.value = compressData.slice(0, 100)

        }

        let LZMAMode = 1

        function LZMACompress() {

            if (LZMAMode > 9) return
            /**
             * LZW 算法  https://baike.baidu.com/item/LZW%E7%AE%97%E6%B3%95
             */

            let originData = defaultOrigin.repeat(10)

            run(LZMAMode)

            LZMAMode++

            function run(mode) {
                let jsHeap0 = performance.memory.usedJSHeapSize
                let t0 = + new Date()
                let compressData = compress(originData, mode)
                console.log(`${mode} 压缩完成 当前使用的内存: ${parseInt((performance.memory.usedJSHeapSize - jsHeap0) / 1000 / 1000)}M`)
                let t1 = + new Date()
                decompress(compressData)
                console.log(`${mode} 解压完成 当前使用的内存: ${parseInt((performance.memory.usedJSHeapSize - jsHeap0) / 1000 / 1000)}M`)
                let t2 = + new Date()
                document.querySelector('#lzma #result').innerHTML += `<p> 模式-${mode}:: 压缩耗时: ${t1 - t0} ms,  解压耗时: ${t2 - t1} ms, 原长度: ${parseInt(originData.length / 1000)}K, 压缩后: ${parseInt(compressData.length) / 1000}K, 压缩比: ${(compressData.length / originData.length).toFixed(4)}</p>`
                console.log(`模式-${mode}:: 压缩耗时: ${t1 - t0} ms,  解压耗时: ${t2 - t1} ms, 原长度: ${parseInt(originData.length / 1000)}K, 压缩后: ${parseInt(compressData.length) / 1000}K, 压缩比: ${(compressData.length / originData.length).toFixed(4)}`)

                compressEle.value = compressData.slice(0, 100)
            }

            function compress(str, mode = 1) {
                return LZMA.compress(str, mode).map(i => String.fromCharCode(i + 256)).join('')
            }

            function decompress(compStr) {
                return LZMA.decompress(compStr.split('').map(i => (i.charCodeAt(0) + 256)))
            }
        }

        window.onload = () => {
            window.initUserJsHeap = performance.memory.usedJSHeapSize
            console.log(`最大可用内存${parseInt(performance.memory.jsHeapSizeLimit / 1000 / 1000)}M`)
            console.log(`初始化完成内存占用 ${parseInt(performance.memory.usedJSHeapSize / 1000 / 1000)}M`)
        }
